css:
@-moz-document url-prefix("https://cisco.webex.com") {
hr,
body,
div.container,
header#top,
main.doc,
div.body
{
    background: #161616 url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAQAAAAECAYAAACp8Z5+AAAAH0lEQVQI12NgYGD4LycnB8cMKioqqAJwBlQlXACmEgCsthUB9mCnuQAAAABJRU5ErkJggg==") repeat;
    color: #aaa;
}

div.t-top-menu,
td.t-top-menu-item,
td.t-top-menu-r {
    border-bottom-color: #000;
    border-right-color: #000;
    border-top-color: #000;
    border-left-color: #000;
    background: #111 url("data:image/png;base64,") repeat !important;
}

div#headerbody,
td.current {
    background-color: rgba(100,100,150,50) !important;
}

html.t-ff.tl-en-US body.f-pc div.t-top div.t-header-group div.t-header div#headerbody div img {
	background: url("data:image/png;base64,") center !important;
}


/*html.t-ff.tl-en-US body.f-pc div.t-top div#top-menu-div.t-top-menu table#top-menu tbody tr td.t-top-menu-item a#wcc-lnk-EC,
html.t-ff.tl-en-US body.f-pc div.t-top div#top-menu-div.t-top-menu table#top-menu tbody tr td.t-top-menu-item a#wcc-lnk-SC,
html.t-ff.tl-en-US body.f-pc div.t-top div#top-menu-div.t-top-menu table#top-menu tbody tr td.t-top-menu-item a#wcc-lnk-TC,*/
td.t-top-menu-item a,
td.t-top-menu-r.t-top-menu-r-full span.t-top-menu-r-bg.t-top-menu-r-bg-full {
    color: rgb(93,151,191) !important;
    background-color: rgba(100,100,100,100);
}

td.current.t-top-menu-item {
	border-bottom-color: #000 !important;
}

td.current.t-top-menu-item a {
    background-color: rgba(120,120,120,100);
}

hr {
    margin-top: 0px;
    margin-bottom: 0px;
    border: 0;
    box-sizing: inherit;
}

article.container,
div.document 
{
    background: #012028;
}

div.body h1, div.body h2, div.body h3, div.body h4, div.body h5, div.body h6
{
    background: none;
    color: #3776A3;
}

html.t-ff.tl-en-US body.pmr_t.t_pmrs.f-pc.to3frame div.t_pmrs_notis div.t_notis_rb div.t_notis_rb_content div.t_notis_rb_inner,
div#navbarcontent ol.leftnav li a#wcc-lnk-newUserRef,
div#navbarcontent ol.leftnav li.drawer a {
    background-color: #222 !important;
}

div#navbarcontent,
div.sphinxsidebar input {
    border: 1px solid #333;
    border-right: 1px solid transparent;
}

div.note {
    background-color: #111;
    border-color: #000;
}

div.related:first-child {
    border-color: #AAA;
}

div#sidebarbutton {
    background-color: #000 !important;
}

a {
    color: #4983AB !important;
}

tt
{
    background: none;
}

pre 
{
    background: #222;
    color: #AAA;
}

.highlight .go /*output*/
{
    color: #AAA;
}

.highlight .gt, .highlight .nf /*tracebacks*/
{
    color: #4772D1;
}

.highlight .nd {
    color: #aaa;
}

table.docutils thead tr {
    background-color: #322;
}

table.docutils tbody tr.row-even {
    background-color: #222;
}

table.docutils tbody tr.row-odd {
    background-color: #181818;
}

table.docutils td, table.docutils th
{
    background-color: inherit;
    border-color: #333;
}

select, input 
{
    background-color: #111;
    color: #AAA;
}

input[name="q"] {
    background-color: #333;
}

select
{
    border-color: #000;
}

dt:target, .highlight {
    background-color: #7C6600;
    color: #EEE;
}

div.warning,
.deprecated, .deprecated-removed {
    background-color: #211;
}

div.seealso {
    background-color: #221;
}

code {
    background-color: inherit !important;
}
}
